use dsnode;
# 修改数据库版本号
call SetDSNodeVersion('0.1.8');

# Account表添加封停标识，新手教学、月卡相关数据
alter table Account add column IsBanned boolean not null; 
update Account set IsBanned = '0' where Account != '';
alter table UserInfo add column NewbieStep bigint not null; 
update UserInfo set NewbieStep = 0 where Guid > 0;
alter table UserInfoExtra add column MonthCardExpireTime char(24) not null; 
update UserInfoExtra set MonthCardExpireTime = '1984/1/1 0:00:00' where Guid > 0;

# 礼包码
create table GiftCode
(
  GiftCode char(32) not null,
  IsValid boolean not null,
  GiftId int not null,
  IsUsed boolean not null,
  UserGuid bigint not null,
  primary key (GiftCode)
) ENGINE=MyISAM;

